import React from 'react';
import Choice from "./Choice/Choice";

function MultipleChoice(props) {


    return (
        <div>
            {props.question.options.length > 0 && props.question.options.map((option,index) => (
                <Choice value={props.question.options[index]+" "+index} name={"id"}/>
            ))}
        </div>
    );
}

export default MultipleChoice;
